{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/heidikeaton/google-capstone-case-study-1?scriptVersionId=93907953\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","source":"","metadata":{}},{"cell_type":"markdown","source":"![Cyclistic image.png](attachment:70f8d52d-ef2c-422b-8298-b1e0ff197af6.png)\n# How does a Bike-Share Navigate a Speedy Success?\n\nLet's say you are the Director of Marketing, Lily Moreno. It is your job to develop initiatives to promote the bike-share program. It would be my job to analyze the reporting data that would help guide Lily to a *new* marketing strategy...increase the membership size.\n\nOne approach that made appealing consumer segments is the flexible pricing plans like single-ride passes, full-day passes and annual memberships. Casual riders are those who purchase single-ride or full-day passes but Lily would like the analytics team to analyze data for converting casual riders in to members.\n\nIn order to convert casual riders in to memberships the analysis needs to: \n- Demonstrate how annual members and casual riders differ?\n- Why would casual riders buy a membership?\n- How would digital media affect marketing tactics?","metadata":{},"attachments":{"70f8d52d-ef2c-422b-8298-b1e0ff197af6.png":{"image/png":""}}},{"cell_type":"markdown","source":"<a id=\"Introduction\"></a>\n# **Divvy Exercise Full Year Analysis**\n\nThis technical analysis is based on the Divvy case study \"'Sophisticated, Clear, and Polished’: Divvy and Data Visualization\" written by Kevin Hartman (found here: https://artscience.blog/home/divvy-dataviz-case-study). \n\nThe purpose of this script is to consolidate downloaded Divvy data into a single dataframe and then conduct simple analysis to help answer the key question: “In what ways do members and casual riders use Divvy bikes differently?”\n\n* Install required packages\n* tidyverse for data import and wrangling\n* lubridate for date functions\n* ggplot for visualization","metadata":{}},{"cell_type":"code","source":"library(tidyverse)  #helps wrangle data\nlibrary(lubridate)  #helps wrangle date attributes\nlibrary(ggplot2)  #helps visualize data\ngetwd() #displays your working directory","metadata":{"_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","_execution_state":"idle","_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-04-24T21:24:57.65287Z","iopub.execute_input":"2022-04-24T21:24:57.655931Z","iopub.status.idle":"2022-04-24T21:24:58.520762Z"},"trusted":true},"execution_count":1,"outputs":[{"name":"stderr","text":"── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n\n\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.6     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.8\n\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.0     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n\n── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n\n\nAttaching package: ‘lubridate’\n\n\nThe following objects are masked from ‘package:base’:\n\n    