l/data.frame)\n $ ride_id           : chr [1:3511511] \"22178529\" \"22178530\" \"22178531\" \"22178532\" ...\n $ started_at        : chr [1:3511511] \"2019-04-01 00:02:22\" \"2019-04-01 00:03:02\" \"2019-04-01 00:11:07\" \"2019-04-01 00:13:01\" ...\n $ ended_at          : chr [1:3511511] \"2019-04-01 00:09:48\" \"2019-04-01 00:20:30\" \"2019-04-01 00:15:19\" \"2019-04-01 00:18:58\" ...\n $ rideable_type     : chr [1:3511511] \"6251\" \"6226\" \"5649\" \"4151\" ...\n $ start_station_id  : num [1:3511511] 81 317 283 26 202 420 503 260 211 211 ...\n $ start_station_name: chr [1:3511511] \"Daley Center Plaza\" \"Wood St & Taylor St\" \"LaSalle St & Jackson Blvd\" \"McClurg Ct & Illinois St\" ...\n $ end_station_id    : num [1:3511511] 56 59 174 133 129 426 500 499 211 211 ...\n $ end_station_name  : chr [1:3511511] \"Desplaines St & Kinzie St\" \"Wabash Ave & Roosevelt Rd\" \"Canal St & Madison St\" \"Kingsbury St & Kinzie St\" ...\n $ member_casual     : chr [1:3511511] \"Subscriber\" \"Subscriber\" \"Subscriber\" \"Subscriber\" ...\n","output_type":"stream"},{"output_type":"display_data","data":{"text/plain":"   ride_id           started_at          ended_at         rideable_type     \n Length:3511511     Length:3511511     Length:3511511     Length:3511511    \n Class :character   Class :character   Class :character   Class :character  \n Mode  :character   Mode  :character   Mode  :character   Mode  :character  \n                                                                            \n                                                                            \n                                                                            \n                                                                            \n start_station_id start_station_name end_station_id  end_station_name  \n Min.   :  1.0    Length:3511511     Min.   :  1.0   Length:3511511    \n 1st Qu.: 77.0    Class :character   1st Qu.: 77.0   Class :character  \n Median :174.0    Mode  :character   Median :174.0   Mode  :character  \n Mean   :202.8                       Mean   :203.7                     \n 3rd Qu.:290.0                       3rd Qu.:291.0                     \n Max.   :675.0                       Max.   :675.0                     \n                                     NA's   :1                         \n member_casual     \n Length:3511511    \n Class :character  \n Mode  :character  \n                   \n                   \n                   \n                   "},"metadata":{}}]},{"cell_type":"markdown","source":"**There are a few problems that need to be fixed:\n* In the \"member_casual\" column, there are two names for members (\"member\" and \"Subscriber\") and two names for casual riders (\"Customer\" and \"casual\"). We will need to consolidate that from four to two labels.\n* The data can only be aggregated at the ride-level, which is too granular. We will want to add some additional columns of data -- such as day, month, year -- that provide additional opportunities to aggregate the data.\n* We will want to add a calculated field for length of ride since the 2020Q1 data did not have the \"tripduration\" column. We will add \"ride_length\" to the entire dataframe for consistency.\n* There are some rides where tripduration shows up as negative, including several hundred rides where Divvy took bikes out of circulation for Quality Control reasons. We will want to delete these rides.\n\n* In the \"member_casual\" column, replace \"Subscriber\" with \"member\" and \"Customer\" with \"casual\"\n* Before 2020, Divvy used different labels for these two types of riders ... we will want to make our dataframe consistent with their current nomenclature\n* N.B.: \"Level\" is a special property of a column that is retained even if a subset does not contain any values from a specific level\n* Begin by seeing how many observations fall under each usertype","metadata":{}},{"cell_type":"code","source":"table(all_trips$member_casual)","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-04-24T21:25:50.988314Z","iopub.execute_input":"2022-04-24T21:25:50.99013Z","iopub.status.idle":"2022-04-24T21:25:51.177201Z"},"trusted":true},"execution_count":13,"outputs":[{"output_type":"display_data","data":{"text/plain":"\n    casual   Customer     member Subscriber \n     48480     786573     378407    2298051 "},"metadata":{}}]},{"cell_type":"markdown","source":"* Reassign to the desired values (we will go with the current 2020 labels)","metadata":{}},{"cell_type":"code","source":"all_trips <-  all_trips %>% \n  mutate(member_casual = recode(member_casual\n                           ,\"Subscriber\" = \"member\"\n                           ,\"Customer\" = \"casual\"))","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-04-24T21:25:51.179275Z","iopub.execute_input":"2022-04-24T21:25:51.180448Z","iopub.status.idle":"2022-04-24T21:25:52.015645Z"},"trusted":true},"execution_count":14,"outputs":[]},{"cell_type":"markdown","source":"* Check to make sure the proper number of observations were reassigned","metadata":{}},{"cell_type":"code","source":"table(all_trips$member_casual)","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-04-24T21:25:52.017759Z","iopub.execute_input":"2022-04-24T21:25:52.018992Z","iopub.status.idle":"2022-04-24T21:25:52.211236Z"},"trusted":true},"execution_count":15,"outputs":[{"output_type":"display_data","data":{"text/plain":"\n casual  member \n 835053 2676458 "},"metadata":{}}]},{"cell_type":"markdown","source":"* Add columns that list the date, month, day, and year of each ride\n* This will allow us to aggregate ride data for each month, day, or year ... before completing these operations we could only aggregate at the ride level\n* https://www.statmethods.net/input/dates.html more on date formats in R found at that link\n* Add a \"ride_length\" calculation to all_trips (in seconds)\n* https://stat.ethz.ch/R-manual/R-devel/library/base/html/difftime.html","metadata":{}},{"cell_type":"code","source":"all_trips$date <- as.Date(all_trips$started_at) #The default format is yyyy-mm-dd\nall_trips$month <- format(as.Date(all_trips$date), \"%m\")\nall_trips$day <- format(as.Date(all_trips$date), \"%d\")\nall_trips$year <- format(as.Date(all_trips$date), \"%Y\")\nall_trips$day_of_week <- format(as.Date(all_trips$date), \"%A\")","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-04-24T21:25:52.213264Z","iopub.execute_input":"2022-04-24T21:25:52.214569Z","iopub.status.idle":"2022-04-24T21:26:00.16171Z"},"trusted":true},"execution_count":16,"outputs":[]},{"cell_type":"markdown","source":"* Inspect the structure of the columns","metadata":{}},{"cell_type":"code","source":"str(all_trips)","metadata":{"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**Remove \"bad\" data**\n* The dataframe includes a few hundred entries when bikes were taken out of docks and checked for quality by Divvy or ride_length was negative\n* We will create a new version of the dataframe (v2) since data is being removed\n* https://www.datasciencemadesimple.com/delete-or-drop-rows-in-r-with-conditions-2/","metadata":{}},{"cell_type":"code","source":"all_trips <- mutate(all_trips, started_at= as.POSIXct(started_at, format = \"%Y-%m-%d %H:%M:%S\") , ended_at= as.POSIXct(ended_at, format = \"%Y-%m-%d %H:%M:%S\") )","metadata":{"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"all_trips$ride_length <- difftime(all_trips$ended_at,all_trips$started_at)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"4.\"></a>\n# ***Step 4: CONDUCT DESCRIPTIVE ANALYSIS***","metadata":{}},{"cell_type":"code","source":"str(all_trips)","metadata":{"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"is.factor(all_trips$ride_length)\nall_trips$ride_length <- as.numeric(as.character(all_trips$ride_length))\nis.numeric(all_trips$ride_length)","metadata":{"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"all_trips_v2 <- all_trips[!(all_trips$start_station_name == \"HQ QR\" | all_trips$ride_length<0),]","metadata":{"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"head(all_trips)","metadata":{"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"* Condense the four lines above to one line using summary() on the specific attribute","metadata":{}},{"cell_type":"code","source":"summary(all_trips_v2 $ ride_length)","metadata":{"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"* Compare members and casual users","metadata":{}},{"cell_type":"code","source":"aggregate(all_trips_v2$ride_length ~ all_trips_v2$member_casual, FUN = mean)\naggregate(all_trips_v2$ride_length ~ all_trips_v2$member_casual, FUN = median)\naggregate(all_trips_v2$ride_length ~ all_trips_v2$member_casual, FUN = max)\naggregate(all_trips_v2$ride_length ~ all_trips_v2$member_casual, FUN = min)","metadata":{"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"* See the average ride time by each day for members vs casual users","metadata":{}},{"cell_type":"code","source":"aggregate(all_trips_v2$ride_length ~ all_trips_v2$member_casual + all_trips_v2$day_of_week, FUN = mean)","metadata":{"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"* Notice that the days of the week are out of order. Let's fix that.","metadata":{}},{"cell_type":"code","source":"all_trips_v2$day_of_week <- ordered(all_trips_v2$day_of_week, levels=c(\"Sunday\", \"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\"))","metadata":{"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"* Now, let's run the average ride time by each day for members vs casual users","metadata":{}},{"cell_type":"code","source":"aggregate(all_trips_v2$ride_length ~ all_trips_v2$member_casual + all_trips_v2$day_of_week, FUN = mean)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"* Analyze ridership data by type and weekday","metadata":{}},{"cell_type":"code","source":"all_trips_v2 %>% \n  mutate(weekday = wday(started_at, label = TRUE)) %>%  #creates weekday field using wday()\n  group_by(member_casual, weekday) %>%  #groups by usertype and weekday\n  summarise(number_of_rides = n()\t\t\t\t\t\t\t#calculates the number of rides and average duration \n  ,average_duration = mean(ride_length)) %>% \t\t# calculates the average duration\n  arrange(member_casual, weekday)\t\t\t\t\t\t\t\t# sorts","metadata":{"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"str(all_trips)","metadata":{"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"* Let's visualize the number of rides by rider type","metadata":{}},{"cell_type":"code","source":"all_trips_v2 %>% \n  mutate(weekday = wday(started_at, label = TRUE)) %>% \n  group_by(member_casual, weekday) %>% \n  summarise(number_of_rides = n()\n            ,average_duration = mean(ride_length)) %>% \n  arrange(member_casual, weekday)  %>% \n  ggplot(aes(x = weekday, y = number_of_rides, fill = member_casual)) +\n  geom_col(position = \"dodge\")","metadata":{"_kg_hide-output":false,"_kg_hide-input":false,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"* Let's create a visualization for average duration","metadata":{}},{"cell_type":"code","source":"all_trips_v2 %>% \n  mutate(weekday = wday(started_at, label = TRUE)) %>% \n  group_by(member_casual, weekday) %>% \n  summarise(number_of_rides = n()\n            ,average_duration = mean(ride_length)) %>% \n  arrange(member_casual, weekday)  %>% \n  ggplot(aes(x = weekday, y = average_duration, fill = member_casual)) +\n  geom_col(position = \"dodge\")","metadata":{"_kg_hide-output":false,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"5.\"></a>\n# ***Step 5: EXORT SUMMARY FILE FOR FUTHER ANALYSIS***\n* Create an .csv file that can be visualized in Excel, Tableau, or my presentation software","metadata":{}},{"cell_type":"code","source":"counts <- aggregate(all_trips_v2$ride_length ~ all_trips_v2$member_casual + all_trips_v2$day_of_week, FUN = mean)\nwrite.csv(counts, file = './avg_ride_length.csv')","metadata":{"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]}]}